webpackJsonp([0xc1ae41d9caf],{876:function(e,a){e.exports={data:{post:{id:"/Users/georgiabarrie/gatsby-afc-guide/content/posts/2017-12-17--east-coast-fever-disease/index.md absPath of file >>> MarkdownRemark",html:'<blockquote style="background: #f2f3f4;">\n<p style="text-align: center; font-weight: 300; font-size: 0.9em">To add your question press <img style="height:2em;" src="https://s3.amazonaws.com/afc-dairytrial/comment_icon.png">  in bottom corner &#x1F447;</p>\n</blockquote>\n<div style="text-align: center">\n<a href="/about"><img style="width: 100%;" src="https://s3.amazonaws.com/afc-dairytrial/key_bar-1.png"></a>\n</div>\n<br><br>\nAs of 1992 East Coast fever was called probably the most important livestock disease of cattle, sheep and goats in Africa, causing an annual loss of 1.1 million cattle and $168 million in 1992...\n<br><br>\n<blockquote style="background: #D7F19F;">\n<h3>What causes East Coast Fever?</h3>\n<p>East Coast Fever is transmitted to cows by the ‚Äúbrown ear tick‚Äù. It is called this because the ticks normally attach themselves to the cow‚Äôs ear.\n<br><br>\nIf you see symptoms of East Coast Fever you must call a vet immediately as cows can die within 3 weeks. There is now a vaccination available to protect cows from the disease.</p>\n<br>\n<div>\n    Source:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/ILRI-logo.png">\n    <b>ILRI</b>\n    <div style="float: right;margin-top:0px;"> <b>21</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<p>Check out our 6 signs to watch out for‚Ä¶</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-7af05.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 84.76764199655766%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="unsplash.com"\n        title=""\n        src="/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-48538.png"\n        srcset="/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-bed0f.png 200w,\n/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-5fd34.png 400w,\n/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-48538.png 800w,\n/static/ecf_symptoms-af2ee5d3e4c5d975af6438b88053daf3-7af05.png 1162w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Top Q&#x26;A from AFC members</h3>\n<p>Josephat asked a common question about ECF vaccinations‚Ä¶</p>\n<blockquote style="background: #6EA6A2;">\n<h3>Josephat‚Äôs Question</h3>\n<p>  I‚Äôve witnessed a number of animals coming down with ECF despite having been vaccinated against the same. Any expert on this?</p>\n  <br>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_dairy_guide_mastitis_wycliffe.png">\n    <b>Josephat W</b>\n    <div style="float: right;margin-top:0px;"> <b>12</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<blockquote style="background: #96e58e;">\n<h3>David‚Äôs Answer</h3>\n<p>It depends with the strain of parasite in the area.n should take in account that introduction of new stock,or wild life or mixing with other animals may result in your cow acquiring a different kind of parasite other than you vaccinated, its advisable to continually washing with accaricide once a week to kill the life cycle of such ticks and avoid mixing new stock immediately you purchase\n<br></br></p>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_logo.png">\n    <b>Davidkariuki</b>\n    <div style="float: right;margin-top:0px;"> <b>31</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<blockquote style="background: #D7F19F;">\n<h3>AFC opinion</h3>\n<p>ECF vaccination will only protect your cattle from one strain of ECF so it is possible for cows to be infected by other strains.\n<br></br>\nThere are also reports of farmers doing the vaccinations themselves (without a trained vet) or buying the vaccination from people who are not registered. If the vaccination is not stored properly and administered properly then the animal will not be protected and could become very sick.\n<br></br></p>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_logo.png">\n    <b>AFC</b>\n    <div style="float: right;margin-top:0px;"> <b>31</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<p>Judy was looking for more information on the best way to spray against ticks‚Ä¶</p>\n<blockquote style="background: #6EA6A2;">\n<h3>Judy‚Äôs Question</h3>\n<p>  My calf has a lot of ticks which is the best to to spray pliz advice</p>\n  <br>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_dairy_guide_mastitis_betty.png">\n    <b>Beatrice K</b>\n    <div style="float: right;margin-top:0px;"> <b>12</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<blockquote style="background: #96e58e;">\n<h3>Gordon‚Äôs Answer</h3>\n<p>Go to an agrovet shop,buy DUO DIP. At home if washing 1 cow,take a Knapsack spray,clean thorough with soapy water to clear any pesticide used before. Pour clean water 2.5 litres into the Knapsack,measure Dupdip 5ml and pour into the Knapsack. Mix thoroughly,then add 2.5 litre of water into the Knapsack then mix thoroughly. If the cow is muddy wash it and allow water to drain. Now spray very all over,the ears,between hooves.thereafter spray the sleeping area and dogs if around.\n<br><br>\nREAD THE LABEL OF THE ACARICIDE YOU HAVE BOUGHT!</p>\n<p><br></br></p>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_logo.png">\n    <b>Gordon A</b>\n    <div style="float: right;margin-top:0px;"> <b>31</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<blockquote style="background: #D7F19F;">\n<h3>AFC opinion</h3>\n<p>Regular spraying of acaricides will help to control ticks. If your calf has a lot of ticks then start by spraying 2-3 times per week. You can reduce to 1 spray per week once you see the ticks reduce. Remember that ticks can become resistant to some sprays so you may need to try different brands to see what is most effective.\n<br><br>\nMake sure that the pasture around your calf isn‚Äôt overgrown and bushy as this can spread ticks. Also make sure the calf isn‚Äôt coming into contact with other animals such as dogs.\n<br></br></p>\n<div>\n    Posted by:\n    <img style="height:3.2em; border-radius: 2em; border: 1px solid #ffff" src="https://s3.amazonaws.com/afc-dairytrial/afc_logo.png">\n    <b>AFC</b>\n    <div style="float: right;margin-top:0px;"> <b>31</b>\n      <a href="#">\n        <img style="height:3.2em; border-radius: 2em;" src="https://s3.amazonaws.com/afc-dairytrial/clap_btn.jpg">\n      </a>\n    </div>\n  </div>\n</blockquote>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/tick_spraying-938cde806901ff8cd697576479402c7b-a50c8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 65.80706781279846%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="unsplash.com"\n        title=""\n        src="/static/tick_spraying-938cde806901ff8cd697576479402c7b-48538.png"\n        srcset="/static/tick_spraying-938cde806901ff8cd697576479402c7b-bed0f.png 200w,\n/static/tick_spraying-938cde806901ff8cd697576479402c7b-5fd34.png 400w,\n/static/tick_spraying-938cde806901ff8cd697576479402c7b-48538.png 800w,\n/static/tick_spraying-938cde806901ff8cd697576479402c7b-a50c8.png 1047w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Got more questions about East Coast Fever? Add your questions in the comments section below‚Ä¶</p>\n<hr>\n<h3>Read more topics</h3>\n<p>There are number of other important topics in this guide:</p>\n<ul>\n<li><a href="/preventing-and-treating-milk-fever">Preventing and treating milk fever</a> ‚≠ê - Guidance on milk fever issues</li>\n<li><a href="/feeding-your-cow-basics">Feeding your cows - basics</a>  ‚≠ê- Understand the basics of feeding</li>\n<li><a href="/feeding-milking-cows">Feeding milking cows</a>  üîí- Know best feeds for milking cows</li>\n</ul>\n<p>‚Ä¶or you can just <a href="/">see all topics</a></p>',fields:{slug:"/east-coast-fever-disease/",prefix:"2017-12-17"},frontmatter:{title:"East Coast Fever Disease",subTitle:"Disease & animal health",cover:{childImageSharp:{resize:{src:"/static/unlock-east-coast-fever-disease-ee1e3537582e06c8fb87162ea63560ee-160fa.png"}}}}},author:{id:"/Users/georgiabarrie/gatsby-afc-guide/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>Africa Farmers Club</strong> has a mission to bring African farmers together!</p>"},footnote:{id:"/Users/georgiabarrie/gatsby-afc-guide/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:"<p>Made with ‚ô•Ô∏è by Africa Farmers Club</p>"},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/east-coast-fever-disease/"}}}});
